article_content:
처음 2개 시킨건 거의 못쓰는 상태로 파손 되어져와서 바로 교환요청했더니 다음날 빠르게 도착 했어요~ 하지만 또 모서리가 다 파손.. 하나는 상판 아래쪽이라 그냥 대충 조립해서 쓰겠지만 하나는 상판 윗부분이라서.. 참.. 사람 피곤하고 귀찮게하네요~ 잘 포장해서 보내주시면 안돼나요? 뽁뽁이가 완충역할을 전혀 못해요~ 좀 더 신경써서 보내주세요~
반품 귀찮아서 하나는 그냥 버려야겠네요;;
이가격에 이제품 비싸요~

이렇게 싼 가격에 가구를 구할수 있을줄은 몰랐네요 ㅋㅋ
이제야 쓰는 상품평이지만 잘 쓰고 있습니다~
조립할때 구멍이 안맞아서 제가 뚫어서 사용하긴 했어요;;;
